    setIsActived(true)

    console.log(isActived)

  }


  return(
    <>


      <Styled.Container onClick={()=>setIsActived(false)} isActived = {isActived}>

      </Styled.Container>

      <Styled.Card isActived = {isActived}>
          Oi
      </Styled.Card>

      <button onClick={()=>handleChange()}>Post</button>




    </>



  )

}

export default App;
